/**
 * @param {number[]} prices
 * @return {number}
 */
var maxProfit = function(prices) {
    prices = prices.filter(function(item, pos, prices) {
        return pos === 0 || item !== prices[pos - 1];
    });

    var profit = 0;
    var i = 0,
        j = prices.length - 1;

    var min = prices[i],
        minIdx = i,
        max = prices[i],
        maxIdx = i;

    for (var i = 0; i < j; ++i) {
        if (i > 0) {
            while (prices[i] > min && i < j)
                i++;
            if (min != prices[i]) {
                min = prices[i];
                minIdx = i;;
            }
        }

        if (i >= maxIdx)
            [tmax, tmaxIdx] = getMax(prices, i + 1, j);
        if (tmax - prices[i] > profit) {
            profit = tmax - prices[i];
            max = tmax;
            maxIdx = tmaxIdx;
        }
        console.log([i, 
            [tmax, tmaxIdx], [prices[i], tmax - prices[i], profit]]);
    }
    return Math.max(0, profit);
}


function getMax(prices, start, maxIdx) {
    var max = prices[maxIdx];
    j = maxIdx;
    while (j >= start) {
        if (prices[j] > max) {
            max = prices[j];
            maxIdx = j;
        }
        j--;
    }
    return [max, maxIdx];
}


